import React, { Component } from "react";
import "./styles.scss";

class TaskBar extends Component {
  render() {
    return (
      <Accordion>
        <Card>
          <Card.Header>
            <Accordion.Toggle variant="link" eventKey="0"></Accordion.Toggle>
          </Card.Header>
        </Card>
      </Accordion>
    );
  }
}

export default TaskBar;
